var isDebug=false;

var HEARTBEAT_HANDLERS = new Array();

function addHeartbeatHandler(_handler) {
	HEARTBEAT_HANDLERS.push(_handler);
}

function startHeartbeat(_callback) {
	var HEARTBEAT_RUNNER = setInterval( function() {
		heartbeat(_callback);
	}, 3000);
}

function getHttpRequest() {
	var request;
	if (window.XMLHttpRequest && !(window.ActiveXObject)) {
		try {
			request = new XMLHttpRequest();
		} catch (e) {
			request = false;
		}
	} else if (window.ActiveXObject) {
		try {
			request = new ActiveXObject("Msxml2.XMLHTTP");
		} catch (e) {
			try {
				request = new ActiveXObject("Microsoft.XMLHTTP");
			} catch (e) {
				request = false;
			}
		}
	}
	return request;
}

function httpGET(_url, _callback) {
	var request = getHttpRequest();
	if (request) {
		request.onreadystatechange = function() {
			if (request.readyState == 4) {
				if (request.status == 200) {
					_callback.success(request.responseText);
				} else {
					_callback.failure(request.status, request.statusText);
				}
			}
		}
		request.open("GET", _url, true);
		request.setRequestHeader("Content-Type", "text/plain; charset=utf-8");
		request.send(null);
	}
}

function httpPOST(_url, _content, _callback) {
	var request = getHttpRequest();
	if (request) {
		request.onreadystatechange = function() {
			if (request.readyState == 4) {
				if (request.status == 200) {
					_callback.success(request.responseText);
				} else {
					_callback.failure(request.status, request.statusText);
				}
			}
		}
		request.open("POST", _url, true);
		request.setRequestHeader("Content-Type", "text/plain; charset=utf-8");
		request.send(_content);
	}
}

function extendPOST(_request, _callback) {
	if(isDebug==true) {
		try {
			var ret=deserialize(_request);
			debugInterface(ret.region,ret.command,_callback);
		} catch(er) {
			alert(er);
		}
	} else {
		httpPOST("/_extendapis/", _request, _callback);
	}
}

function getRequestMsgAsString(_region, _command, _content) {
	var ret = new Object();
	ret.region = _region;
	ret.command = _command;
	ret.success = true;
	ret.content = _content;
	return serialize(ret);
}

function deserialize(_string) {
	return eval("(" + _string + ")");
}

function serialize(obj) {
	var returnVal;
	if (obj != undefined) {
		switch (obj.constructor) {
			case Array:
				var vArr = "[";
				for (var i = 0; i < obj.length; i++) {
					if (i > 0)
						vArr += ",";
					vArr += serialize(obj[i]);
				}
				vArr += "]"
				return vArr;
			case String:
				returnVal = '"' + escape(obj) + '"';
				return returnVal;
			case Number:
				returnVal = isFinite(obj) ? obj.toString() : null;
				return returnVal;
			case Date:
				returnVal = "#" + obj + "#";
				return returnVal;
			default:
				if (typeof obj == "object") {
					var vobj = [];
					for (attr in obj) {
						if (typeof obj[attr] != "function") {
							vobj.push('"' + attr + '":' + serialize(obj[attr]));
						}
					}
					if (vobj.length > 0)
						return "{" + vobj.join(",") + "}";
					else
						return "{}";
				} else {
					return obj.toString();
				}
		}
	}
	return null;
}

